(196396305, 'Chevrolet', 'Other', 'For Sale', 'Benzine', '13,094', 'Price', 'Cash', 2012, '20000', '29999', 'Automatic', 'Used', 'Black', 'Sedan', '1400 - 1500', 'Not Available', 'Not Available', 'امكانيه التقسيط حتى 36 شهر\r\nعربيه ذوي الاحتياجات سعرها 13,094$ السعر يشمل الترخيص والجواب والجمارك فات على فك الحظر 6 شهور\r\nعربيه فابريكا بدون رش داخل او خارج السياره\r\nتعمل بمحركين كهربائي وبنزين\r\nحصدت (Chevrolet Volt) على تقييم 5/5 في اختبار الأمن والسلامة الوطني الأمريكي، مما يجعلها من أكثر السيارات أمانا في عصرنا الحالي. تحتوي على كاميرا للرؤية الخلفية.  فيها عشر وسائد هوائية موزعة في الداخل لحماية جميع الركاب.  تنبيه السائق بحال وجود مركبة في النقاط العمياء.  استخدام الفولاذ العالي القوة في الأماكن الحرجة من السيارة.  تأتي سيارة شيفروليه فولت بمحركين كهربائي ومحرك بنزين. محرك البنزين يأتي ب 4 سلندر 1500 سي سي، وبقوة 101 حصان، مع خزان وقود بسعة 35 لتر، والمحرك الكهربائي مع بطارية ليثيوم تولد قدرة مقدارها 19 كيلو واط، مما يجعلها سيارة متكاملة وصديقة للبيئة. تستطيع السير بالسيارة مسافة 65 كم عند شحنها كاملا، حيث أظهرت الدراسات أن معظم الناس يسيرون مسافة 65 كم يوميا إلى عملهم ذهابا وإيابا، فنادرا سوف تستخدم محرك الوقود، وسيقلل ذلك اعتمادك على المحروقات بشكل كبير. تمتلك سيارة شيفروليه فولت مظهر خارجي مميز وجذاب، يعطيك إحساسا بالتميز والاناقة. الأداء، تصل سرعة السيارة القصوى إلى 160 كم/ساعة، حيث تعد سيارة عائلية بامتياز. الاتزان على المنعطفات:، تصميم السيارة الديناميكي، ونظام تعليقها المتطور، يعطيان ثبات رائع على المنعطفات\r\nللتواصل على 01110555136 او 01148544456 او الرقم الارضي 0225787129', 'Downtown Cairo, Cairo'),
